import React from 'react';
import { Route } from 'react-router-dom';
import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <div className="App">
                  <Route exact path='/login' render= {(props) => { return <Login  {...props}  />}} />

    </div>
  );
}

export default App;
